import React from "react";
import mcqData from "./data";

const QueAns = () => {
  return (
    <>
      <div>
        {mcqData.map((elem) => {
          let { id, que, ans } = elem;
          return (<>
          {id}
          </>);
        })}
      </div>
    </>
  );
};

export default QueAns;
